function SelectUrl(value) {//根据输入来对发送数据的进行判断

  if (value != "" && value != null) {
    var reg = /^[A-Za-z0-9\,\-\s+]+$/ //只包含数字，字母，逗号等

      
    var reg_han = /[\u4E00-\u9FA5\uF900-\uFA2D]/ //只包含汉字
    if (reg.test(value))
      var key_data_Temp_En = value;
    else if (reg_han.test(value))
      var key_data_Temp_Han = value;
  }//防止用户乱输入,一直向服务器发请求

  if (key_data_Temp_En != undefined)//英译汉处理
  {
    var ResData = EnToCnData(key_data_Temp_En);
    if (ResData.error)
      return { error: true }
    else {//英译汉
      return {
        SearchList: [],//汉译英占用
        kind: "EnToCn",
        SeletData: ResData.SeletData,
        key_data_Temp: ResData.key_data_Temp,
        error: false
      }
    }
  }
  else if (key_data_Temp_Han != undefined)//汉译英处理
  {
    var ResData = CnToEnData(key_data_Temp_Han);
    if (ResData.error)
      return { error: true }
    else {//汉译英
      return {
        SearchList: ResData.SearchList,//汉译英占用
        kind: "CnToEn",
        SeletData: ResData.SeletData,
        key_data_Temp: ResData.key_data_Temp,
        error: false
      }
    }
  }
  else {
    return { error: true }
  }

}


